import React from 'react';
import {useTranslation} from "react-i18next";
import { useHistory } from 'react-router-dom';

// Cài đặt Logistic.
export const Settings = () => {

  const {t} = useTranslation('common');
  const history = useHistory();

  function onClick1(){
    history.push("/logistics/inStockConfig");
  }

  function onClick2(){
    history.push("/logistics/dateWithFacilityConfig");
  }

  function onClick3(){
    history.push("/logistics/brandConfig");
  }

  function onClick4(){
    history.push("/logistics/productBrandConfig");
  }

  return (
    <>
      <div className="p-grid">
        <div className="p-col-6">
          <div className="card" style={{cursor: 'pointer'}}>
            <div className="p-d-flex p-flex-row p-flex-wrap" onClick={onClick1}>
              <img className="p-m-1" src="images/shipment-packing.png" alt={t('logistics.settings.inStockConfig')} style={{width: 48, height: 48}}/>
                <h5>{t('logistics.settings.inStockConfig')}</h5>
            </div>
          </div>
        </div>

        <div className="p-col-6">
          <div className="card" style={{cursor: 'pointer'}}>
            <div className="p-d-flex p-flex-row p-flex-wrap" onClick={onClick2}>
              <img className="p-m-1" src="images/custom_time_period.png" alt={t('logistics.settings.dateWithFacility')} style={{width: 48, height: 48}}/>
              <h5>{t('logistics.settings.dateWithFacility')}</h5>
            </div>
          </div>
        </div>

        <div className="p-col-6">
          <div className="card" style={{cursor: 'pointer'}}>
            <div className="p-d-flex p-flex-row p-flex-wrap" onClick={onClick3}>
              <img className="p-m-1" src="images/config_label.png" alt={t('logistics.settings.brand')} style={{width: 48, height: 48}}/>
                <h5>{t('logistics.settings.brand')}</h5>
            </div>
          </div>
        </div>

        <div className="p-col-6">
          <div className="card" style={{cursor: 'pointer'}}>
            <div className="p-d-flex p-flex-row p-flex-wrap" onClick={onClick4}>
              <img className="p-m-1" src="images/config_product_label.png" alt={t('logistics.settings.productBrand')} style={{width: 48, height: 48}}/>
                <h5>{t('logistics.settings.productBrand')}</h5>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
